import React, { Component } from 'react';
import './App.css';
import Joke from './components/Joke';
import JokesData from './components/JokesData';

const App = () => {
  jokesData.
  return (
    <div>
      <Joke question="Hello" punchLine="World"/>
      <Joke punchLine="Yeye"/>
      <Joke question="How's it hanging" punchLine="Good"/>
    </div>
  );
}
export default App;
